import React from 'react'
import { Navbar, Container, Nav } from 'react-bootstrap';

const Header = ({isAuth}:boolean) => {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" collapseOnSelect>
      <Container>
        <Navbar.Brand href="/">DesksRus</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            {isAuth === false && <Nav.Link href="/signup">SignUp</Nav.Link> }
            {!isAuth && <Nav.Link href="/login">Login</Nav.Link> }
            <Nav.Link href="/store">Store</Nav.Link>
            <Nav.Link href="/dashboard">Store</Nav.Link>
            <Nav.Link href="/orders">Store</Nav.Link>
            <Nav.Link href="/transactions">Store</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}


export default Header
